// Deal with parameters passed to the page
// As parameters are mutually exclusive we only process the first parameter
// 
// http://www.babelstone.co.uk/Unicode/unicode.html?name=Character Name
// http://www.babelstone.co.uk/Unicode/unicode.html?find=string
// http://www.babelstone.co.uk/Unicode/unicode.html?char=1234
// http://www.babelstone.co.uk/Unicode/unicode.html?char=random
// 
function ProcessPageParams()
{
	var handled = false;

	if ( location.search )
	{
		var params = location.search.substring(1).split( "&" );
		var a = params[0].split( "=" );
		var param = a[0].toLowerCase();
		var value = unescape( a[1] );

		if ( param == "char" )
		{
			if ( value.toLowerCase() == "random" )
			{
				OnRandomCharacter();
			}
			else
			{
				document.getElementById( "gototext" ).value = value;
				OnGotoButton();
			}
			handled = true;
		}
		else if ( param == "find" )
		{
			document.getElementById( "searchtext" ).value = value;
			OnSearchButton();
			handled = true;
		}
		else if ( param == "name" )
		{
			document.getElementById( "searchcheck" ).checked = true;
			document.getElementById( "searchtext" ).value = value;
			OnSearchButton();
			handled = true;
		}
	}

	// Set to "X" initially if not otherwise specified
	if ( handled == false )
	{
		SetCharacter( 0, "0058" );
	}
}

